import ColumnFilter from './ColumnFilter';

let COLUMNS = [
    {
        Header: 'Name',
        accessor: 'full_name',
        Filter: ColumnFilter,
        disableFilters: true,
        disableSortBy: true,
        width: 90
    },
    {
        Header: 'Pos',
        accessor: 'pos',
        Filter: ColumnFilter,
        disableSortBy: true
    },
    {
        Header: 'Ovr',
        accessor: 'ovr',
        Filter: ColumnFilter,
        disableFilters: true,
    }
];

export {COLUMNS};
